import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
    <h1>On + It</h1>
    <p>A simple progress tracking app</p>
    <nav>
      <ul>
        <li>Home</li>
        <li>Register</li>
        <li>Login</li>
        <li></li>
      </ul>
    </nav>
    </div>
  );
}

export default App;
